import React,{Component} from 'react';
import {Link} from 'react-router-dom';
class Studentopentesthistory extends Component
{
    state={
        prevTest:null
    }
    componentDidMount(){     
        const user={
            email:JSON.parse(localStorage.getItem("jwt")).user.id
           // email:"shivikasingla12@gmail.com"
          }
        //   console.log(user)
          fetch("http://localhost:8082/studenttesthistory", {
          method: "POST",
          headers: {
            "Content-Type": "application/json"
          },
          body: JSON.stringify(user)
        })
          .then(res => res.json())
          .then(res => {
            if(res.data==null)
            {
              alert("not run");
            }
            else
            {
            console.log(res.data)
            this.setState({prevTest:res.data})

             console.log(this.state.prevTest);
            }
          }); 
    }

    funcdate=(str)=>{
        str=str.split('T')
        let time=str[1].split('.')
        return(str[0]+" "+time[0]);
    }
    render()
    {
        return (
            <div class="container-fluid">
                <center><h3 class="text-dark mb-4">Previous Tests Given</h3></center>
                <div class="card shadow">
                    <div class="card-header py-3">
                        <p class="text-primary m-0 font-weight-bold">Test Info</p>
                    </div>
                    <div class="card-body">
                        <div class="row">
                            <div class="col-md-6 text-nowrap">
                                <div id="dataTable_length" class="dataTables_length" aria-controls="dataTable"><label>Show&nbsp;<select class="form-control form-control-sm custom-select custom-select-sm"><option value="10" selected="">10</option><option value="25">25</option><option value="50">50</option><option value="100">100</option></select>&nbsp;</label></div>
                            </div>
                            <div class="col-md-6">
                                <div class="text-md-right dataTables_filter" id="dataTable_filter"><label><input type="search" class="form-control form-control-sm" aria-controls="dataTable" placeholder="Search"/></label></div>
                            </div>
                        </div>
                        <div class="table-responsive table mt-2" id="dataTable" role="grid" aria-describedby="dataTable_info">
                            <table class="table dataTable my-0" id="dataTable">
                                <thead>
                                    <tr>
                                        <th>S.No</th>
                                        <th>TeacherId</th>
                                        <th>Test Id</th>
                                        <th>Marks</th>
                                        <th>View analysis</th>
                                    </tr>
                                </thead>
                                <tbody>
                                {this.state.prevTest?this.state.prevTest.map((t,index)=>{
                                return <tr>
                                        <td>{index+1}</td>
                                        <td>{t.tid}</td>
                                         <td>{t.testid}</td>
                                        <td>{t.marks}</td>
                                        <td><Link to={"viewTestanalysis/?id="+t.testid}>Click here</Link></td>
                                    </tr>
                                  }):<div>loading...</div>
                               }
                                </tbody>
                                <tfoot>
                                    <tr>
                                        <td><strong>S.No</strong></td>
                                        <td><strong>TeacherId</strong></td>
                                        <td><strong>Test Id</strong></td>
                                        <td><strong>Marks</strong></td>
                                        <td><strong>View Analysis</strong></td>
                                    </tr>
                                </tfoot>
                            </table>
                        </div>

                    </div>
                </div>
            </div>
        )
    }
}
export default Studentopentesthistory;
